import React from 'react'
import { Outlet, Link } from "react-router-dom";

export default function Layout() {
  return (
    <div>
        <div className="container">
            <ul>
                <Link to="/">Home</Link>
            
                    <Link to="/about"></Link>

                <Link to="/contact"></Link>
            </ul>
        </div>
        <Outlet/>
    </div>
  )
}
